var rooms = [];

$('.room').each(function() {
  var features = [];
  $(this).find('.feature').each(function() {
	features.push($(this).text());
  });

  $(this).find('h3, a').remove();
  var room = {
    id : $(this).attr('id'),
    features: features,
    description: $(this).find('description').html()
  }

  rooms.push(room);
});
return rooms;

